import React, {Component} from 'react';

class form extends Component {
  constructor(props) {
    super();
    this.question = props.question;
  }

render() {
  return (
    <form id="survey-form">
          <h2> {this.question} </h2>

          <div class="form-group">
        <label>
          <input name="user-recommend" value="Music" type="radio" class="input-radio"/>Music</label>
        <label>
          <input name="user-recommend" value="acting" type="radio" class="input-radio" />Acting</label>
        <label><input name="user-recommend" value="story" type="radio" class="input-radio" />Story</label>
        <label><input name="user-recommend" value="actors" type="radio" class="input-radio" />Actors</label>
      </div>

         <button type="submit" id="submit" class="submit-button">
          Submit
        </button>

     </form>
);
}
}

export default form;
